VALUES
	(11,'材质优选|真丝系带上衣',',1,',',100,',',1000,','尺寸信息\r\nS号：肩宽37CM，胸围92CM，袖长40CM，衣长56CM。\r\nM号：肩宽38CM，胸围96CM，袖长41CM，衣长58CM。\r\nL号：肩宽39CM，胸围100CM，袖长42CM，衣长60CM。\r\n搭配推荐\r\n这款采用天然材质百分百桑蚕丝制作，面料轻薄透气，设计采用与众不同的后领系带法，配以中西结合俏皮的佛系印花，使衣服显得灵动，又不失淑女风。建议下半身搭配包身款半裙或牛仔裤。\r\n尺码指导\r\n宽松尺码，面料无弹，喜欢穿着宽松的可选平常所穿尺码或大一码。\r\n产品信息\r\n真丝雪纺面料，后领系带宽松款，100%桑蚕丝。建议干洗或轻柔手洗，平铺晾晒，严禁烘干',1099.00,1099.00,0,'1',759,'2','2',11,'zzc2018t0001','自在楚',0,'2018-10-13 19:32:46','2018-10-18 11:47:38'),
	(12,'材质优选|牛仔阔腿裤',',2,',',100,102,103,',',1000,','尺码信息\r\nS号：腰围64CM，裤长101CM。\r\nM号：腰围68CM，裤长103CM。\r\nL号：腰围72CM，裤长105CM。\r\n搭配推荐\r\n这款牛仔超级阔腿裤是like i give a sheep品牌的单品之一，造型挺括，具有一定的摩擦力，纯棉牛仔。搭配针织紧身上衣或套头毛衣或衬衫，优雅大方，又利落贤淑，很有女性气质。\r\n尺码指导\r\n此款为修身款，属于常规标准尺码，适合中等身材或稍瘦个子偏高的人群穿着\r\n产品信息\r\n主料：100%棉，为修身长款版型，超级阔腿设计，无弹。建议干洗或轻柔手洗，严禁烘干。',980.00,980.00,0,'1',852,'2','2',12,'LGS2018P0053','Like i give a sheep',0,'2018-10-13 19:32:46','2018-10-18 11:48:08'),
	(14,'材质优选|格纹斜裁半裙',',3,',',101,',',1000,','尺码信息\r\nS号：腰围64CM，臀围94CM，裙长83CM。\r\nM号：腰围68CM，臀围98CM，裙长85CM。\r\nL号：腰围72CM，臀围102CM，裙长87CM。\r\n搭配推荐\r\n这款羊毛格纹斜裁半裙是like i give a sheep品牌的单品之一，手感柔软，具有一定的摩擦力，羊毛含量高，保暖性好，里料滑爽舒服，体贴肌肤。搭配针织紧身上衣或套头毛衣或衬衫，优雅大方，又利落贤淑，很有女性气质。\r\n材质介绍\r\n羊毛（wool）是绵羊的羊毛，是秋冬季节性价比最高的选择。羊毛上身温暖，光泽自然，织物纹理清晰，不易掉毛起球。\r\n尺码指导\r\n此款为修身款，属于常规标准尺码，适合中等身材或稍瘦个子偏高的人群穿着。\r\n产品信息\r\n主料：80%羊毛20%聚酯纤维，里料：100%聚酯纤维，为修身中长款版型，前面做不规则设计，斜裁微弹。建议干洗或轻柔手洗，严禁烘干。',1480.00,1480.00,0,'1',943,'1','2',14,'LGS2018S0052','Like i give a sheep',1,'2018-10-13 19:32:46','2018-11-07 11:56:44'),
	(15,'材质优选|马海毛毛衣',',4,',',100,102,103,',',1000,','尺码信息\r\n均码F：胸围116CM，袖长（插肩袖）81CM，衣长77CM。\r\n搭配推荐\r\n这款宽松马海毛毛衣是like i give a sheep品牌非常畅销的单品之一。材质选用天然的马海毛与羊毛混纺，穿着轻柔保暖，简约时尚。大圆领插肩袖设计包容多种身材。建议下半身搭配牛仔裤。\r\n材质介绍\r\n马海毛（mohair）是安哥拉山羊毛，而非早年流行于市的晴纶仿马海毛，“马海”一词来源于阿拉伯文，意为“似蚕丝的山羊毛织物”。 轻而蓬松，不毡化，不起毛起球，高档的手感和独特的天然光泽在纺织纤维中是独一无二的，珍贵程度紧次于羊绒。\r\n尺码指导\r\n宽松尺码，针织面料带弹，喜欢穿着宽松的可选平常所穿尺码或大一码。\r\n产品信息\r\n马海毛混纺针织面料，套头宽松落肩款，38%马海毛 28%羊毛 34%腈纶。建议干洗或轻柔手洗，平铺晾干，严禁烘干。',1080.00,1080.00,0,'1',847,'2','2',15,'LGS2018STR0051','Like i give a sheep',0,'2018-10-13 19:32:46','2018-11-02 13:11:00'),
	(16,'材质优选|针织连衣裙',',5,',',100,102,103,104,',',1000,','尺码信息\r\nS号：肩宽37CM，胸围72CM，袖长66CM，衣长104CM。\r\nM号：肩宽38CM，胸围76CM，袖长67CM，衣长106CM。\r\nL号：肩宽39CM，胸围80CM，袖长68CM，衣长108CM。 \r\n搭配推荐\r\n这款羊驼毛长款针织衫，手感软糯温和，质地密实轻柔，羊驼毛和羊毛混纺，具有极好的保暖性，长款收腰，修饰人的身材比列，达到显高显瘦的效果。搭配风衣长外套或羊毛羊绒长外套，再配一双长靴，婀娜妩媚，风情万种，女人味尽显。\r\n材质介绍\r\n羊驼毛(alpaca)是羊驼身上的绒毛，是极细几乎没有针毛的纤维，贴身穿着不扎，是常年供不应求的珍贵纤维。羊驼毛织物具有丝绸般的光泽，轻薄柔软保暖而不易起球。\r\n尺码指导\r\n此款为修身长款，适合中等身材稍瘦偏高的女生穿着，面料带有弹力，稍丰腴的女生也可穿着。\r\n产品信息\r\n32%超细羊驼毛、32%美丽奴羊毛、30%锦纶和6%氨纶混纺，长款修身，有弹力。建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1580.00,1580.00,0,'1',835,'2','2',16,'LGS2018DS0050','Like i give a sheep',0,'2018-10-13 19:32:46','2018-11-02 13:13:37'),
