	(19,'材质优选|针织连衣裙',',5,',',100,102,103,104,',',1000,','尺码信息\r\nS号：肩宽37CM，胸围72CM，袖长66CM，衣长104CM。\r\nM号：肩宽38CM，胸围76CM，袖长67CM，衣长106CM。\r\nL号：肩宽39CM，胸围80CM，袖长68CM，衣长108CM。\r\n搭配推荐\r\n这款羊驼毛长款针织衫，手感软糯温和，质地密实轻柔，羊驼毛和羊毛混纺，具有极好的保暖性，长款收腰，修饰人的身材比列，达到显高显瘦的效果。搭配风衣长外套或羊毛羊绒长外套，再配一双长靴，婀娜妩媚，风情万种，女人味尽显。\r\n材质介绍\r\n羊驼毛(alpaca)是羊驼身上的绒毛，是极细几乎没有针毛的纤维，贴身穿着不扎，是常年供不应求的珍贵纤维。羊驼毛织物具有丝绸般的光泽，轻薄柔软保暖而不易起球。\r\n尺码指导\r\n此款为修身长款，适合中等身材稍瘦偏高的女生穿着，面料带有弹力，稍丰腴的女生也可穿着。\r\n产品信息\r\n32%超细羊驼毛、32%美丽奴羊毛、30%锦纶和6%氨纶混纺，长款修身，有弹力，建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1580.00,1580.00,0,'1',833,'2','2',16,'LGS2018DS0030','Like i give a sheep',0,'2018-10-13 19:32:46','2018-11-02 13:14:38'),
	(20,'材质优选|细幼马海毛毛衣',',4,',',100,102,103,',',1000,','尺码信息\r\nS号：肩宽（落肩）50CM，胸围122CM，袖长54CM，衣长60CM。\r\nM号：肩宽（落肩）58CM，胸围124CM，袖长56CM，衣长62CM。\r\n搭配推荐\r\n这款细幼马海毛毛衣是like i give a sheep品牌非常畅销的单品之一。材质选用天然的细幼马海毛与羊毛混纺，穿着轻柔保暖，简约时尚。落肩宽松设计包容多种身材，颜色选择多。建议下半身搭配包身款半裙或牛仔裤。\r\n材质介绍\r\n马海毛（mohair）是安哥拉山羊毛，而非早年流行于市的晴纶仿马海毛，“马海”一词来源于阿拉伯文，意为“似蚕丝的山羊毛织物”。 轻而蓬松，不毡化，不起毛起球，高档的手感和独特的天然光泽在纺织纤维中是独一无二的，珍贵程度紧次于羊绒。细幼马海毛(baby mohair)为幼龄羊所产羊毛，一只安哥拉山羊一生只能出一次的超轻薄柔软的羊毛纤维，视觉上绒毛感强，手感柔顺，上身温暖舒适。\r\n尺码指导\r\n宽松尺码，针织面料带弹，喜欢穿着宽松的可选平常所穿尺码或大一码。\r\n产品信息\r\n粉色杂纱细幼马海毛混纺针织面料，套头宽松落肩款，34%细幼马海毛 34%羊毛 27%聚酯纤维 5%弹力纤维，建议干洗或轻柔手洗，严禁烘干。',1580.00,1580.00,0,'1',881,'2','2',20,'LGS2018STR0001','Like i give a sheep',1,'2018-10-13 19:32:46','2018-11-02 13:05:46'),
