	(29,'材质优选|高领毛衣',',4,',',100,101,103,104,',',1000,','尺码信息\r\n均码F：肩宽65CM，胸围118CM，袖长50CM，衣长52CM。\r\n搭配推荐\r\n这款羊毛羊绒高领毛衣由设计师品牌like i give a sheep品牌出品，天然的羊毛羊绒按比例混纺，穿在身上既有羊绒的柔软轻薄，又有羊毛的透气舒适，短款的设计适合搭配高腰款的裤子或包身半裙，时髦有型的同时温暖舒适。\r\n材质介绍\r\n羊绒（Cashmere）是生长在山羊外表皮层，掩在山羊粗毛根部的一层薄薄的细绒，入冬寒冷时长出，抵御风寒，开春转暖后脱落，自然适应气候，属于稀有的特种动物纤维。同等重量的羊绒远比羊毛昂贵的多也保暖的多，各种仿羊毛纤维如晴纶就更无法与之相比。羊绒手感极为柔软，可贴身穿着。这款毛衣的纱线来自一家进口供货商，羊绒中混入50％的羊毛增加织物的轮廓感，主打可以机洗。但我们仍然建议您轻柔手洗或使用洗衣机的轻柔手洗档。 \r\n尺码指导\r\n此款为宽松均码，适合喜欢宽松休闲风格的人群。\r\n产品信息\r\n50%羊毛 50%羊绒，宽松短款，建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1350.00,1350.00,0,'1',792,'2','2',29,'LGS2018STR0006','Like i give a sheep',0,'2018-10-13 19:32:46','2018-11-02 14:08:32'),
