	(41,'材质优选|羊绒毛衣',',4,',',100,101,103,104,',',1000,','尺码信息\r\n均码F：肩宽68CM，胸围110CM，袖长68CM，衣长53CM。\r\n搭配推荐\r\n这款羊绒毛衣是like i give a sheep品牌的热销款之一，100%羊绒的质地柔软舒适，款式简单百搭，质感无敌，下身搭配包身半裙或裤装时髦精致，浅卡其色与浅蓝色可选。\r\n材质介绍\r\n羊绒（Cashmere）是生长在山羊外表皮层，掩在山羊粗毛根部的一层薄薄的细绒，入冬寒冷时长出，抵御风寒，开春转暖后脱落，自然适应气候，属于稀有的特种动物纤维。同等重量的羊绒远比羊毛昂贵的多也保暖的多，各种仿羊毛纤维如晴纶就更无法与之相比。羊绒手感极为柔软，可贴身穿着。\r\n尺码指导\r\n宽松落肩款适合喜欢宽松风格人群。\r\n产品信息\r\n100%羊绒，短款宽松，建议干洗或轻柔手洗，平铺晾晒，严禁烘干',1780.00,1780.00,0,'1',760,'2','2',41,'LGS2018STR0021','Like i give a sheep',0,'2018-10-13 19:32:46','2018-11-02 14:13:41'),
