	(46,'材质优选|羊毛短开衫',',6,',',100,103,',',1000,','尺码信息\r\n均码F：肩宽49CM，胸围100CM，袖长52CM，衣长51CM。\r\n搭配推荐\r\n这款羊毛小开衫，用料丰满，100%羊毛，既温暖舒适又结实耐穿，内搭紧身高领毛衣或随意的收身上衣，复古又时髦，再配一顶洋气的帽子，青春洒脱，文艺范满满。下身可搭深色裤子，起到颜色的层次对比作用，刺激人的视觉神经，彰显青春与复古。\r\n尺码指导\r\n此款为均码，上大下小款式，适合中等身材，或稍胖稍瘦的人群穿着。\r\n产品信息\r\n100%羊毛精纺，短款宽松，建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1080.00,1080.00,0,'1',791,'2','2',46,'LGS2018STR0026','Like i give a sheep',0,'2018-10-13 19:32:46','2018-10-17 17:45:39'),
	(47,'材质优选|露肩针织上衣',',1,',',103,104,',',1000,','尺码信息\r\n均码F：肩宽29CM，胸围70CM，袖长49CM，衣长58CM。\r\n搭配推荐\r\n这款丝羊绒露肩上衣手感柔软温和，质地密实软糯，丝羊绒混纺，保暖性极好，露肩设计，微收身，有很好的收腰效果。搭配牛仔裤，羊毛直筒裤阔腿裤喇叭裤或半裙均可，利落娴熟，都市女人范，上班逛街随意切换。\r\n尺码指导\r\n此款为均码，稍小，有微弹力，适合中等身材，或稍瘦微胖的人群穿着。\r\n产品信息\r\n45%真丝和55%羊绒混纺，中等长度，微紧。建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1280.00,1280.00,0,'1',890,'2','2',47,'LGS2018STR0043','Like i give a sheep',0,'2018-10-13 19:32:46','2018-10-17 17:46:28'),
	(48,'材质优选|露肩针织上衣',',1,',',103,104,',',1000,','尺码信息\r\n均码F：肩宽29CM，胸围70CM，袖长49CM，衣长58CM。\r\n搭配推荐\r\n这款丝羊绒露肩上衣手感柔软温和，质地密实软糯，丝羊绒混纺，保暖性极好，露肩设计，微收身，有很好的收腰效果。搭配牛仔裤，羊毛直筒裤阔腿裤喇叭裤或半裙均可，利落娴熟，都市女人范，上班逛街随意切换。\r\n材质介绍\r\n真丝（silk）被称为“纤维皇后”，以其独特的魅力受到古往今来的人的青睐，丝素中含有18种对人体有益的氨基酸。丝织品具有良好的吸湿、透气性能，手感柔软、滑爽、厚实、丰满，弹性优异。真丝上身舒适轻薄，光泽性强但不刺眼。2017年以来，全球生丝供应紧张导致的丝价暴涨，真丝织物的价格呈倍数增长趋势。真丝的舒适、轻薄，色泽的自然优雅是任何其他天然面料以及新型面料无法替代的。\r\n羊绒（Cashmere）是生长在山羊外表皮层，掩在山羊粗毛根部的一层薄薄的细绒，入冬寒冷时长出，抵御风寒，开春转暖后脱落，自然适应气候，属于稀有的特种动物纤维。同等重量的羊绒远比羊毛昂贵的多也保暖的多，各种仿羊毛纤维如晴纶就更无法与之相比。羊绒手感极为柔软，可贴身穿着。\r\n尺码指导\r\n此款为均码，稍小，有微弹力，适合中等身材，或稍瘦微胖的人群穿着。\r\n产品信息\r\n45%真丝和55%羊绒混纺，中等长度，微紧。建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1280.00,1280.00,0,'1',945,'1','2',47,'LGS2018STR0029','Like i give a sheep',1,'2018-10-13 19:32:46','2018-11-07 11:55:40'),
