	(54,'材质优选|羊毛毛衣',',4,',',100,101,103,',',1000,','尺码信息\r\nS号：肩宽（落肩）56CM，胸围136CM，袖长62CM，衣长58CM。\r\nM号：肩宽（落肩）58CM，胸围138CM，袖长64CM，衣长60CM。\r\nL号：肩宽（落肩）59CM，胸围140CM，袖长66CM，衣长62CM。\r\n搭配推荐\r\n这款宽松条纹短款针织毛衣，质地柔软，穿着温暖舒适，羊毛羊绒混纺，保暖性极好。搭配羊毛直筒裤或牛仔裤，清新靓丽，干净又贤淑。\r\n材质介绍\r\n\r\n羊绒（Cashmere）是生长在山羊外表皮层，掩在山羊粗毛根部的一层薄薄的细绒，入冬寒冷时长出，抵御风寒，开春转暖后脱落，自然适应气候，属于稀有的特种动物纤维。同等重量的羊绒远比羊毛昂贵的多也保暖的多，各种仿羊毛纤维如晴纶就更无法与之相比。羊绒手感极为柔软，可贴身穿着。这款毛衣的纱线来自一家进口供货商，羊绒中混入50％的羊毛增加织物的轮廓感，主打可以机洗。但我们仍然建议您轻柔手洗或使用洗衣机的轻柔手洗档。 \r\n尺码指导\r\n此款为宽松大条纹款，适合中等身材或稍丰腴的人穿着。\r\n产品信息\r\n50%羊毛和50%羊绒混纺，长度适中，宽松版型，带弹力，建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1080.00,1080.00,0,'1',754,'2','2',53,'LGS2018STR0036','Like i give a sheep',0,'2018-10-13 19:32:46','2018-11-02 14:14:58'),
