	(126,'材质优选|系带连衣裙',',5,',',104,',',1000,','尺码信息\r\nS号：肩宽37CM，胸围84CM，袖长55CM，裙长96CM。\r\nM号：肩宽38CM，胸围88CM，袖长56CM，裙长98CM。\r\nL号：肩宽39CM，胸围92CM，袖长57CM，裙长100CM。\r\n搭配推荐\r\n这款半裙是Miss Wei品牌单品之一。材质选用真丝印花面料，内衬也是100%真丝，面料不透，表面柔滑细腻，手感柔软，垂坠性好，透气舒适，款式简介大方，显瘦修身版型，简约显气质，领口系带设计。建议搭配大衣或羽绒服。\r\n材质介绍\r\n真丝（silk）被称为“纤维皇后”，以其独特的魅力受到古往今来的人的青睐，丝素中含有18种对人体有益的氨基酸。丝织品具有良好的吸湿、透气性能，手感柔软、滑爽、厚实、丰满，弹性优异。真丝上身舒适轻薄，光泽性强但不刺眼。2017年以来，全球生丝供应紧张导致的丝价暴涨，真丝织物的价格呈倍数增长趋势。真丝的舒适、轻薄，色泽的自然优雅是任何其他天然面料以及新型面料无法替代的。\r\n尺码指导\r\n合身尺码，真丝面料无弹，喜欢穿着宽松的可选平常所穿尺码或大一码。\r\n产品信息\r\n面料为100%真丝，里衬为100%真丝。建议干洗或轻柔手洗，平铺晾干，严禁烘干。',2219.00,2219.00,0,'1',901,'2','2',121,'MW2018D007','MISS WEI',0,'2018-10-13 19:32:46','2018-11-07 12:10:19'),
