	(230,'羊毛立领连衣裙',',5,',',101,102,103,104,',',1000,','尺码信息\r\nS号：肩宽36CM，胸围88CM，腰围84CM，袖长54CM，裙长92CM。\r\nM号：肩宽37CM，胸围92CM，腰围88CM，袖长55CM，裙长94CM。\r\nL号：肩宽38CM，胸围96CM，腰围92CM，袖长56CM，裙长96CM。\r\n搭配推荐\r\n这款羊毛立领连衣裙是濛品牌的经典款之一，质地密实，穿着温暖舒适，羊毛含量高，具有很好的保暖性，小立领捏褶设计，可拉长颈部比例，凸显气质。可单穿，也可搭配风衣外套或者羊毛大衣，落落大方，优雅贤淑，非常温婉动人。\r\n材质介绍\r\n\r\n羊毛（wool）是绵羊的羊毛，是秋冬季节性价比最高的选择。羊毛上身温暖，光泽自然，织物纹理清晰，不易掉毛起球。\r\n真丝（silk）被称为“纤维皇后”，以其独特的魅力受到古往今来的人的青睐，丝素中含有18种对人体有益的氨基酸。丝织品具有良好的吸湿、透气性能，手感柔软、滑爽、厚实、丰满，弹性优异。真丝上身舒适轻薄，光泽性强但不刺眼。2017年以来，全球生丝供应紧张导致的丝价暴涨，真丝织物的价格呈倍数增长趋势。真丝的舒适、轻薄，色泽的自然优雅是任何其他天然面料以及新型面料无法替代的。\r\n尺码指导\r\n此款为稍宽松合身款，属于常规标准尺码，适合中等身材或稍丰腴的人群穿着。\r\n产品信息\r\n面料为50%精纺羊毛50%粘纤，里衬为95%真丝5%氨纶，为合身中长版型，小立领设计，无弹。建议干洗或轻柔手洗，严禁烘干。',1799.00,1799.00,0,'1',922,'2','2',230,'M2018DS0029','MENG濛',0,'2018-10-16 15:31:31','2018-11-07 12:04:37'),
