	(243,'羊毛拼接立领长袖连衣裙',',5,',',101,102,103,104,',',1000,','尺码信息\r\nS号：肩宽35CM，胸围84CM，腰围74CM，袖长56CM，裙长85CM。\r\nM号：肩宽36CM，胸围88CM，腰围78CM，袖长57CM，裙长87CM。\r\nL号：肩宽37CM，胸围92CM，腰围82CM，袖长58CM，裙长89CM。\r\n搭配推荐\r\n这款羊毛拼接立领长袖连衣裙是濛品牌的单品之一，精纺纯羊毛面料，质地密实，穿着温暖舒适，具有很好的保暖性，拼接小立领设计，可拉长颈部比例，凸显气质。可搭配针织修身打底单穿，也可搭配风衣外套或者羊毛大衣，落落大方，优雅贤淑，非常温婉动人。\r\n材质介绍\r\n羊毛（wool）是绵羊的羊毛，是秋冬季节性价比最高的选择。羊毛上身温暖，光泽自然，织物纹理清晰，不易掉毛起球。\r\n真丝（silk）被称为“纤维皇后”，以其独特的魅力受到古往今来的人的青睐，丝素中含有18种对人体有益的氨基酸。丝织品具有良好的吸湿、透气性能，手感柔软、滑爽、厚实、丰满，弹性优异。真丝上身舒适轻薄，光泽性强但不刺眼。2017年以来，全球生丝供应紧张导致的丝价暴涨，真丝织物的价格呈倍数增长趋势。真丝的舒适、轻薄，色泽的自然优雅是任何其他天然面料以及新型面料无法替代的。\r\n尺码指导\r\n此款为稍宽松合身款，属于常规标准尺码，适合中等身材或稍丰腴的人群穿着。\r\n产品信息\r\n面料1为丝棉混纺，面料2为60%羊毛20%莱卡20%聚酯纤维 里衬为100%真丝，为合身中长版型，拼接设计，无弹。建议干洗或轻柔手洗，严禁烘干。',1699.00,1699.00,0,'1',905,'2','2',243,'M2018DS0038','MENG濛',0,'2018-10-16 16:09:25','2018-11-07 12:06:32'),
	(244,'喇叭袖基础羊毛毛衣',',4,',',100,101,102,103,104,',',1000,','尺码信息\r\nS号：肩宽36CM，胸围78CM，袖长57CM，衣长48CM。\r\nM号：肩宽37CM，胸围82CM，袖长58CM，衣长50CM。\r\nL号：肩宽38CM，胸围86CM，袖长59CM，衣长52CM。\r\n搭配推荐\r\n这款喇叭袖基础羊毛毛衣，手感柔软温和，织造密实，穿着温暖舒适，羊绒含量高，具有很好的保暖性。搭配羊毛直筒裤，微喇叭裤等或者牛仔裤半裙，都非常的出彩大方，温婉动人，颜色为亮黄色，很衬肌肤，显得落落大方。\r\n材质介绍\r\n羊绒（Cashmere）是生长在山羊外表皮层，掩在山羊粗毛根部的一层薄薄的细绒，入冬寒冷时长出，抵御风寒，开春转暖后脱落，自然适应气候，属于稀有的特种动物纤维。同等重量的羊绒远比羊毛昂贵的多也保暖的多，各种仿羊毛纤维如晴纶就更无法与之相比。羊绒手感极为柔软，可贴身穿着。羊绒中混入20％的羊毛以增加织物的轮廓感，即以羊毛增加了花纹的立体感，又保留了羊绒的轻柔舒适。\r\n尺码指导\r\n此款为修身短款，属于常规标准尺码，适合中等身材或稍瘦稍丰腴的人群穿着。\r\n产品信息\r\n80%羊绒，20%羊毛，修身短款版型，袖子作喇叭袖设计，有弹力。建议干洗或轻柔手洗，严禁烘干。						\r\n',1629.00,1629.00,0,'1',994,'2','2',244,'M2018STR0009','MENG濛',0,'2018-10-16 16:10:50','2018-11-02 14:10:35'),
