	(254,'羊毛小西装',',8,',',101,103,104,',',1000,','尺码信息\r\nS号：肩宽36CM，胸围90CM，袖长54CM，衣长65CM。\r\nM号：肩宽37CM，胸围94CM，袖长55CM，衣长67CM。\r\nL号：肩宽38CM，胸围98CM，袖长56CM，衣长69CM。  \r\n搭配推荐\r\n这款精仿羊毛小西装，手感柔软轻盈，羊毛含量较高，穿着温暖舒适，面料高档。搭配羊毛西装裤或羊毛套装，干练利落，优雅从容，时髦打破陈规。\r\n尺码指导\r\n此款为修身款，属于常规标准尺码，适合中等身材或稍瘦稍丰腴的人群穿着。\r\n产品信息\r\n面料为60%羊毛20%莱卡20%聚酯纤维，里衬为100%真丝，为修身款版型，长度适中，无弹。建议干洗或轻柔手洗，严禁烘干。					\r\n',2199.00,2199.00,0,'1',768,'2','2',254,'M2018T0018','MENG濛',0,'2018-10-16 16:43:36','2018-10-18 18:45:57'),
