	(256,'真丝印花尖领灯笼袖上衣',',9,',',101,103,104,',',1000,','尺码信息\r\nS号：肩宽36CM，胸围90CM，袖长56CM，衣长63CM。\r\nM号：肩宽37CM，胸围94CM，袖长57CM，衣长65CM。\r\nL号：肩宽38CM，胸围98CM，袖长58CM，衣长67CM。\r\n搭配推荐\r\n这款印花灯笼袖上衣，轻薄透气，手感柔软爽滑，100%真丝，用料充足，穿在身上冰凉舒适。搭配真丝半裙或牛仔裤西装裤，优雅大方，贤淑温柔，非常柔美。\r\n材质介绍\r\n真丝（silk）被称为“纤维皇后”，以其独特的魅力受到古往今来的人的青睐，丝素中含有18种对人体有益的氨基酸。丝织品具有良好的吸湿、透气性能，手感柔软、滑爽、厚实、丰满，弹性优异。真丝上身舒适轻薄，光泽性强但不刺眼。2017年以来，全球生丝供应紧张导致的丝价暴涨，真丝织物的价格呈倍数增长趋势。真丝的舒适、轻薄，色泽的自然优雅是任何其他天然面料以及新型面料无法替代的。\r\n尺码指导\r\n此款为合身上衣，属于常规标准尺码，适合中等身材或稍丰腴的人群穿着。\r\n产品信息\r\n100%真丝，尖领设计，短俏版型，无弹。建议干洗或轻柔手洗，严禁烘干。						',1499.00,1499.00,0,'1',898,'2','2',256,'M2018T0018','MENG濛',0,'2018-10-16 16:45:19','2018-11-07 12:10:56'),
