	(267,'真丝丝绒拼接荷叶边抽绳连衣裙',',5,',',100,101,103,104,',',1000,','尺码信息\r\nS号：肩宽37CM，胸围90CM，腰围90CM，袖长55CM，裙长82CM。\r\nM号：肩宽38CM，胸围94CM，腰围94CM，袖长56CM，裙长84CM。\r\nL号：肩宽39CM，胸围98CM，腰围98CM，袖长57CM，裙长86CM。\r\n搭配推荐\r\n这款真丝丝绒拼接荷叶边抽绳连衣裙是濛品牌的经典款之一，材质选用真丝丝绒面料，面料不透，表面柔滑细腻，手感柔软，垂坠性好，透气舒适，拼接镂空蕾丝设计，可拉长颈部比例，凸显气质。可单穿，也可搭配风衣外套或者羊毛大衣，落落大方，优雅贤淑，非常温婉动人。\r\n材质介绍\r\n真丝（velvet）丝绒是底布使用100％桑蚕丝，绒面为100％粘纤的割绒丝织物。真丝丝绒手感柔软，上身轻薄温暖，绒面光泽奢华。真丝丝绒上身效果极佳，它以其特有的柔顺质感，修饰曲线。\r\n尺码指导\r\n此款为稍宽松合身款，属于常规标准尺码，适合中等身材或稍丰腴的人群穿着。\r\n产品信息\r\n面料1为真丝丝绒混纺，面料2为100%棉，为合身中长版型，拼接荷叶边抽绳设计，无弹。建议干洗或轻柔手洗，严禁烘干。',1499.00,1499.00,0,'1',947,'2','2',267,'M2018DS0045','MENG濛',0,'2018-10-16 17:09:14','2018-11-07 11:53:37'),
	(268,'羊毛金丝条纹直通半裙',',3,',',100,101,102,103,104,',',1000,','尺码信息\r\nS号：腰围68CM，臀围86CM，裙长61CM。\r\nM号：腰围72CM，臀围90CM，裙长63CM。\r\nL号：腰围76CM，臀围94CM，裙长65CM。\r\n搭配推荐\r\n这款羊毛金丝条纹直筒裙半裙是濛品牌的经典款之一。金丝混纺羊毛面料，里衬为100%真丝，质感厚实，保暖性好，。搭配衬衫或宽松毛衣，时尚吸睛，落落大方，优雅贤淑，非常温婉动人。可外搭大衣或羽绒服。\r\n材质介绍\r\n羊毛（wool）是绵羊的羊毛，是秋冬季节性价比最高的选择。羊毛上身温暖，光泽自然，织物纹理清晰，不易掉毛起球。\r\n真丝（silk）被称为“纤维皇后”，以其独特的魅力受到古往今来的人的青睐，丝素中含有18种对人体有益的氨基酸。丝织品具有良好的吸湿、透气性能，手感柔软、滑爽、厚实、丰满，弹性优异。真丝上身舒适轻薄，光泽性强但不刺眼。2017年以来，全球生丝供应紧张导致的丝价暴涨，真丝织物的价格呈倍数增长趋势。真丝的舒适、轻薄，色泽的自然优雅是任何其他天然面料以及新型面料无法替代的。\r\n尺码指导\r\n此款为直臀合身款，属于常规标准尺码，适合中等身材或稍丰腴的人群穿着。\r\n产品信息\r\n面料为600%羊毛40%金丝，里衬为100%真丝，为合身中长版型，直筒设计，无弹。建议干洗或轻柔手洗，严禁烘干。',899.00,899.00,0,'1',993,'2','2',268,'M2018S0048','MENG濛',1,'2018-10-16 17:20:22','2018-11-07 11:18:23'),
