	(325,'V领竖条纹羊绒衫',',1,4,',',100,101,102,103,104,',',1000,','尺码信息                                                                                          \r\n均码F：肩宽44CM，胸围108CM，袖长71CM，衣长61CM                                                                \r\n搭配推荐                                                                                         \r\n这款V领竖条纹羊绒衫，采用天然羊毛羊绒混纺材质，选用红色与白色的撞色设计，简洁大方，再搭配牛仔裤或者阔腿裤、半裙等，保暖舒适，简约时尚。                                                           \r\n材质介绍\r\n羊绒（Cashmere）是生长在山羊外表皮层，掩在山羊粗毛根部的一层薄薄的细绒，入冬寒冷时长出，抵御风寒，开春转暖后脱落，自然适应气候，属于稀有的特种动物纤维。同等重量的羊绒远比羊毛昂贵的多也保暖的多，各种仿羊毛纤维如晴纶就更无法与之相比。羊绒手感极为柔软，可贴身穿着。羊绒中混入20％的羊毛以增加织物的轮廓感，即以羊毛增加了花纹的立体感，又保留了羊绒的轻柔舒适。\r\n尺码指导                                                                                             \r\n此款为均码略宽松款，适合喜欢休闲宽松风格的人群。                                                   \r\n产品信息                                                                                        \r\n80%羊绒20%羊毛，略宽松套头毛衣，建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1980.00,1980.00,0,'1',329,'2','2',325,'LG2018STR0063','Like i give a sheep',0,'2018-10-30 13:58:43','2018-11-02 14:16:16'),
	(326,'后背系带吊带连衣裙',',5,',',100,102,103,104,',',1000,','尺码信息                                                                                          \r\nS号：肩宽不限，胸围80CM，袖长54CM，衣长121CM。                                                  \r\nM号：肩宽不限，胸围84CM，袖长56CM，衣长123CM。\r\n搭配推荐                                                                                         \r\n这款后背系带吊带连衣裙，采用天然羊毛混纺材质，使用别出心裁的后背系带设计，可自动调节胸围大小，再搭配高领丝羊绒毛衣或者衬衫等，保暖舒适，简约时尚。                  \r\n尺码指导                                                                                             \r\n此款为略上合身下身宽松款，适合喜欢休闲宽松风格的人群。                                                   \r\n产品信息                                                                                        \r\n70%羊毛30%锦纶，后背系带连衣裙，建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1450.00,1450.00,0,'1',700,'2','2',326,'LGS2018DS0064','Like i give a sheep',0,'2018-11-01 17:32:10','2018-11-01 17:42:54'),
	(327,'羊驼毛羊毛纯色套头毛衣',',1,4,',',100,101,102,103,104,',',1000,','尺码信息                                                                                        \r\n均码F：肩宽53CM，胸围122CM，袖长64CM，衣长66CM。                                                  \r\n搭配推荐                                                                                        \r\n这款羊驼毛羊毛混纺套头毛衣，采用天然材质，保证了穿着的温暖，选用横向同色调的撞色设计，配以宽大缩口袖，再搭配牛仔裤，慵懒时尚的同时，保暖舒适，宽松的设计对身材的包容性极强。                                  \r\n材质介绍\r\n羊驼毛(alpaca)是羊驼身上的绒毛，是极细几乎没有针毛的纤维，贴身穿着不扎，是常年供不应求的珍贵纤维。羊驼毛织物具有丝绸般的光泽，轻薄柔软保暖而不易起球。\r\n尺码指导                                                                                         \r\n此款为均码宽松款，适合喜欢休闲宽松风格的人群。                                                             \r\n产品信息                                                                                       \r\n32%精纺羊驼毛32%美丽诺羊毛30%聚酯纤维6%弹力丝，宽松套头毛衣，建议干洗或轻柔手洗，平铺晾晒，严禁烘干。',1350.00,1350.00,0,'1',999,'2','2',302,'LG2018STR0061','Like i give a sheep',4,'2018-11-02 12:55:54','2018-11-02 12:59:13'),
	(328,'细幼马海毛毛衣',',1,4,',',100,101,102,103,104,',',1000,','尺码信息                                                                                     \r\nS号：肩宽（落肩）50CM，胸围122CM，袖长54CM，衣长60CM。                                                M号：肩宽（落肩）58CM，胸围124CM，袖长56CM，衣长62CM。                                            \r\n搭配推荐                                                                                        \r\n这款细幼马海毛毛衣是like i give a sheep品牌非常畅销的单品之一。材质选用天然的细幼马海毛与羊毛混纺，穿着轻柔保暖，简约时尚。落肩宽松设计包容多种身材，颜色选择多。建议下半身搭配包身款半裙或牛仔裤。                 \r\n材质介绍\r\n细幼马海毛，马海毛（mohair）是安哥拉山羊毛，而非早年流行于市的晴纶仿马海毛，“马海”一词来源于阿拉伯文，意为“似蚕丝的山羊毛织物”。 轻而蓬松，不毡化，不起毛起球，高档的手感和独特的天然光泽在纺织纤维中是独一无二的，珍贵程度紧次于羊绒。细幼马海毛(baby mohair)为幼龄羊所产羊毛，一只安哥拉山羊一生只能出一次的超轻薄柔软的羊毛纤维，视觉上绒毛感强，手感柔顺，上身温暖舒适。                                                         \r\n尺码指导                                                                                         \r\n宽松尺码，针织面料带弹，喜欢穿着宽松的可选平常所穿尺码或大一码。\r\n产品信息                                                                                         \r\n花绿色杂纱细幼马海毛混纺针织面料，套头宽松落肩款，34%细幼马海毛 34%羊毛 27%聚酯纤维 5%弹力纤维，建议干洗或轻柔手洗，严禁烘干。',1580.00,1580.00,0,'1',771,'2','2',20,'LGS2018STR0062','Like i give a sheep',0,'2018-11-02 12:59:42','2018-11-02 13:01:17'),
	(329,'撞线直筒裤',',2,',',100,101,102,103,104,',',1001,','尺码信息\r\nM号：腰围73CM，臀围92CM，裤长102CM。                                                                                 搭配推荐  \r\n这款撞线直筒裤是VVCEN品牌的单品之一，腰部利用荷包形式的设计，简约优雅，以黑色为底，白色缝线，使整体充满活力，不单调，裤口采用不规则开叉，充满设计感。搭配衬衫或者高领毛衫及宽松毛衣等，时尚百搭，充满女人味。                                                                                      \r\n尺码指导\r\n此款为基础款，属于常规标准尺码，适合中等身材或稍瘦的人群穿着。                             \r\n产品信息\r\n96.4%聚酯纤维3.6%氨纶  里料：100%聚酯纤维，为基础版型。建议干洗或轻柔手洗。',1488.00,1488.00,0,'1',997,'2','2',329,'18020403黑','VVCEN',3,'2018-11-02 18:02:35','2018-11-02 18:03:33');
